response.activities:
Обучение игре на клавишных инструментах, фортепиано, рояле, пианино:                                                1) Обучение технике игры большинства произведений классических, традиционных и современных музыкальных стилей;                                                                  2) Использование нового подхода, где само обучение игре на фортепиано, сочинение и импровизация преподаются одновременно;    
3) Возможность изучения музыкальных стилей на самых ярких и различных примерах   
Пишите в личку или по почте:  piano@land.ru  звоните: 8 (903) 581 5372 или заходите на сайт piano.land.ru
